import React, { useEffect, useState } from "react";
import { useAuth } from "../Context/AuthContext";
import { 
  getWishlist, 
  deleteWishlistItem,
  moveToCart 
} from "../Services/wishlistService";
import { Link } from "react-router-dom";
import './Wishlist.css';

const Wishlist = () => {
  const { user } = useAuth();
  const [wishlist, setWishlist] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchWishlist = async () => {
      if (!user) return;
      
      try {
        setLoading(true);
        const wishlistData = await getWishlist(user._id);
        setWishlist(wishlistData.items || []);
        setError("");
      } catch (error) {
        console.error("Error fetching wishlist:", error);
        setError(error.message || "Failed to fetch wishlist");
      } finally {
        setLoading(false);
      }
    };
    
    fetchWishlist();
  }, [user]);

  const handleRemoveItem = async (productId) => {
    try {
      await deleteWishlistItem(user._id, productId);
      setWishlist(wishlist.filter(item => item.productId._id !== productId));
      setError("");
    } catch (error) {
      console.error("Error removing item:", error);
      setError(error.message || "Failed to remove item");
    }
  };

  const handleMoveToCart = async (productId) => {
    try {
      await moveToCart(user._id, productId);
      setWishlist(wishlist.filter(item => item.productId._id !== productId));
      setError("");
      alert("Item moved to cart successfully!");
    } catch (error) {
      console.error("Error moving to cart:", error);
      setError(error.message || "Failed to move item to cart");
    }
  };

  if (!user) {
    return (
      <div className="wishlist-container">
        <h2>My Wishlist</h2>
        <p>Please login to view your wishlist</p>
      </div>
    );
  }

  if (loading) {
    return (
      <div className="wishlist-container">
        <h2>My Wishlist</h2>
        <p>Loading your wishlist...</p>
      </div>
    );
  }

  return (
    <div className="wishlist-container">
      <h2>My Wishlist</h2>
      {error && <div className="error-message">{error}</div>}
      
      {wishlist.length === 0 ? (
        <div className="empty-wishlist">
          <p>Your wishlist is empty</p>
          <Link to="/products" className="shop-now-btn">
            Shop Now
          </Link>
        </div>
      ) : (
        <div className="wishlist-items">
          {wishlist.map((item) => (
            <div key={item.productId._id} className="wishlist-item">
              <Link to={`/products/${item.productId._id}`} className="item-link">
                <img 
                  src={item.productId.image || '/placeholder-image.jpg'} 
                  alt={item.productId.name}
                  className="item-image"
                />
                <div className="item-details">
                  <h3>{item.productId.name}</h3>
                  <p>Rs. {item.productId.price.toFixed(2)}</p>
                </div>
              </Link>
              <div className="item-actions">
                <button 
                  onClick={() => handleMoveToCart(item.productId._id)}
                  className="move-to-cart-btn"
                >
                  Move to Cart
                </button>
                <button 
                  onClick={() => handleRemoveItem(item.productId._id)}
                  className="remove-item-btn"
                >
                  Remove
                </button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Wishlist;
